import React from 'react'
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import SearchBar from './SearchBar';
import Exercises from './Exercises';


function SelectExercises() {
  return (
    <>
    <Container maxWidth="1600" 
    sx={{
      display: 'flex',
      flexDirection: 'column',
      height: '100vh',
    }}>
      <Box sx={{ 
        padding: '1em',
        display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
      width: 'auto'
        }}>
          <Typography sx={{ 
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '3em', 
            fontWeight: '400',
            marginTop: '1.5em',
            color: 'primary.dark',
            marginBottom: '0.5em',
            }}>
              Choose your exercises</Typography>
            <SearchBar/>
            <Box sx={{ 
            padding: '1em',
            display: 'flex',
          flexDirection: 'row',
          justifyContent: 'center',
          alignItems: 'center',
          width: 'auto'
            }}>
              <Typography>Push</Typography>
    <Typography>Pull</Typography>
    <Typography>Legs</Typography>
            </Box>
              <Box sx={{ 
            padding: '1em',
            display: 'flex',
          flexDirection: 'row',
          justifyContent: 'center',
          alignItems: 'center',
          width: 'auto'
            }}>
          <Button variant="contained" sx={{ 
            backgroundColor: 'primary.main',
            marginTop: '1em',
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '3em', 
            fontWeight: '500',
            width: '7em',
            borderRadius: '20px',
            marginRight: '1em'
            }}>Go Back</Button>
            <Button variant="contained" sx={{ 
            backgroundColor: 'primary.main',
            marginTop: '1em',
            fontFamily: 'Shadows Into Light, cursive', 
            fontSize: '3em', 
            fontWeight: '500',
            width: '7em',
            borderRadius: '20px',
            marginRight: '1em'
            }}>Next</Button>
            </Box>
          </Box>
      </Container>
    </>
  )
}

export default SelectExercises
